import "./nav.css";

export default function NavBar() {
  return (
    <div className="navBox">
      <p className="homeText">PORTFOLIO</p>
      <ul>
        <li>ABOUT</li>
        <li>GOAL</li>
        <li>CONTACT</li>
      </ul>
    </div>  
  )
}
